import React from "react";
import { PhoneIcon, ArrowSmRightIcon } from "@heroicons/react/outline";
import { ChipIcon, SupportIcon } from "@heroicons/react/solid";
import supportImg from "../assets/support.jpeg";

const Support = () => {
  return (
    <div>
      <div>
        <img src={supportImg} alt="/" />
      </div>
      <div>
        <div>
          <h2>Support</h2>
          <h3>Finding the right team</h3>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit.
            Accusantium autem ea, ipsam aperiam hic excepturi aut eveniet, vel
            libero laborum, dolorem culpa. Repudiandae praesentium quasi
            provident, eveniet nemo quos suscipit!
          </p>
        </div>
      </div>
    </div>
  );
};

export default Support;
